import { Flex,VStack,HStack } from '@chakra-ui/layout';
import { withScriptjs, withGoogleMap, GoogleMap, Marker, InfoWindow } from "react-google-maps"
import {useState,useEffect} from "react";
import Autocomplete from "react-google-autocomplete";


export const CustomPlan=()=>{
    
    return(
        <>
       

        
             <GMAP />
            

       
        
    
        
        </>
    )
}










export const Map=()=>{
  const [open,setOpen]=useState(false);
  const [place,setPlace]=useState({})
  
    return(
        <>
        <HStack>

          <Flex>fjdfh</Flex>
       <Flex>
        <Autocomplete style={{width:"40%" ,height:"30px", padding:"5px", margin:"auto"}}
        apiKey={"AIzaSyCB9FiwGVeEmdfBAwxiQpPuz0fsDMiwPWY"}

        onPlaceSelected={(place) => {
            console.log(place);
            setPlace(place.geometry.location)
        }}

        options={{
            types: ['geocode' , 'establishment'],
            componentRestrictions: { country: "LK" },
            fields:["ALL"]
        }}
        >

        </Autocomplete>

          <GoogleMap style={{height:"50vh"}}
            defaultZoom={8}
            defaultCenter={{ lat: .291418, lng:80.636696}}
            // defaultOptions={{ styles: mapStyles }}
          >
              <Marker position={place} />
          </GoogleMap>
          </Flex>
          </HStack>  
        </>
    )
}

const MapWrapped = withScriptjs(withGoogleMap(Map));


export  function GMAP() {
    return (
        <Flex height="100vh" flexDirection="column" mx="auto" my="2" boxShadow="dark-lg">
        <MapWrapped
          googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyCB9FiwGVeEmdfBAwxiQpPuz0fsDMiwPWY`}
          loadingElement={<div style={{ height: `100%` }} />}
          containerElement={<div style={{ height: `100%` ,width:"100%" }} />}
          mapElement={<div style={{ width: `50%`, height:"80%" }} />}
        />
      </Flex>
    );
  }
